import React from 'react';
import './Hero.css'
export default function Navbar() {
  return (
    <div className='container'>
      <div className='row justify-content-center'>
        <div className='col-8 navbar-container'>
          <ul style={{listStyle:"none",display:"flex",columnGap:"100px"}}>
            <li style={{fontSize:"30px"}}>home</li>
            <li style={{fontSize:"30px"}}>contact us</li>
            <li style={{fontSize:"30px"}}>Author</li>
            <li style={{fontSize:"30px"}}>Login</li>

          </ul>
        </div>
      </div>
    </div>
  );
}
